純正ドアミラーウィンカーのレンズを交換するだけでよりスタイリッシュなドアミラーに！高輝度LED採用で視認性も向上し、安全性もアップ！レンズ中央のチューブがブルーのデイライトまたはスモールに点灯。ウィンカー使用時にはオレンジの点滅点灯に切り替わります。<br><br>魅力的な2つの機能【機能1】高輝度LED+LEDライトバー2本が発光し、抜群の視認性を発揮します。【機能2】2本のライトバーがブルーに発光。ウインカー時には消灯し、アンバー色で点滅します。配線方法により、常時点灯またはスモールランプに連動して点灯させることが可能です。<br><br>■5LED＋2LEDチューブ　■ウインカー時：オレンジ発光　デイライト/スモール：ブルー発光　■付属品：配線ｘ２、配線カプラーｘ４　※純正ウインカーミラー装着車用。社外ミラー/ミラーカバー装着車およびウインカーミラー非装着車には取り付けできません。<br><br>対応車種：ヴェルファイア/アルファード (H20/05～)・ノア/ヴォクシー(H19/06～ )・エスティマ (H18/06～)/bB 後期(H20/10～)・RAV4(08/09～)・ラクティス (H17/10～)・ポルテ 後期(H19/06～・パッソセッテ (H20/12～ ※Xグレードオプション装着車)・ヴァンガード(H19/08～)・シエンタ (H18/5-H23/4)・ラッシュ (H18/1～)・ビーゴ<tr><td colspan="2">
