純正ドアミラーウィンカーのレンズを交換するだけでよりスタイリッシュなドアミラーに！高輝度LED採用で視認性も向上し、安全性もアップ！レンズ中央のチューブがブルーのデイライトまたはスモールに点灯。ウィンカー使用時にはオレンジの点滅点灯に切り替わります。レンズ底面のホワイトのLEDレンズはウェルカムランプとして点灯します。<br><br>魅力的な3つの機能【機能1】高輝度LED+LEDライトバー2本が発光し、抜群の視認性を発揮します。【機能2】2本のライトバーがブルーに発光。ウインカー時には消灯し、アンバー色で点滅します。配線方法により、常時点灯またはスモールランプに連動して点灯させることが可能です。【機能3】足元を明るく照らすウエルカムランプは高輝度LEDを使用し、ドアのUNLOCKに連動してウエルカムランプが点灯します。スマートエントリーシステム装着車ではルームランプに連動したウェルカムランプの点灯が可能。<br><br>■8LED＋3LED　■ウェルカムライト機能　■ウインカー時：オレンジ発光　デイライト/スモール：ブルー発光　■付属品：配線ｘ２、配線カプラーｘ４　※純正ウインカーミラー装着車用。社外ミラー/ミラーカバー装着車およびウインカーミラー非装着車には取り付けできません。<br><br>対応車種：30プリウス(H21/5-)・20系ウィッシュ(H21/5～)・130系マークX後期(H21/10～)・10系マークXジオ(H21/2～)・30系パッソ(H22/2～)・iQ(H20/12～)・45カムリ後期(H21/1～)・206/207クラウンマジェスタ(H21/3～)・AZK10サイ(H21/12～)・200系クラウン(H20/2～)<tr><td colspan="2">
